import React, { Component } from 'react';
import { connect } from 'react-redux';
import  DataState  from './Data';
class PublisherRecord extends Component {
    render() {
        return (<div>
            <table className="BookRecord">
                <thead>
                    <tr>
                        <td>Sr No</td>
                        <td>Book Title</td>
                        <td>Cover</td>
                        <td>Publisher</td>
                        <td>No of Books</td>
                        <td>Action</td>
                    </tr>
                </thead>
                <tbody>
                    <DataState />
                </tbody>
            </table>
        </div>);
    }
}
export default connect()(PublisherRecord);
